/**
 * Design System Optimized Components
 * 
 * Re-exporting all components from the adapter
 */

export {
  // Layout
  Box,
  Container,
  Grid,
  Paper,
  Stack,

  // Typography
  Typography,

  // Display
  Card,
  CardContent,
  CardActions,
  List,
  ListItem,
  ListItemText,
  Divider,

  // App Components
  AppBar,
  Toolbar,

  // Feedback
  Alert,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Tooltip,

  // Inputs
  IconButton,

  // Theme
  ThemeProvider,

  // Icons
  KeyboardArrowUpIcon,

  // Forms
  Button,
  TextField,
  Checkbox,

  // Navigation
  Tab,
  Tabs
} from './adapter';

export default {
  // Layout
  Box,
  Container,
  Grid,
  Paper,
  Stack,

  // Typography
  Typography,

  // Display
  Card,
  CardContent,
  CardActions,
  List,
  ListItem,
  ListItemText,
  Divider,

  // App Components
  AppBar,
  Toolbar,

  // Feedback
  Alert,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Tooltip,

  // Inputs
  IconButton,

  // Theme
  ThemeProvider,

  // Icons
  KeyboardArrowUpIcon,

  // Forms
  Button,
  TextField,
  Checkbox,

  // Navigation
  Tab,
  Tabs
};
